// import { useState } from 'react';
import './App.css';

function App() {

  const onSubmitHandler = async (e) => {
    e.preventDefault();
    try {
      const fake_data = {
        'name': 'eric',
        'age': 20,
      }

      const response = await fetch('http://127.0.0.1:5000/rec', {
        method: 'POST',
        headers: {
          "Access-Control-Allow-Origin": "*",
          'Content-Type': 'application/json',
        },
        body: JSON.stringify(fake_data),
      })
      const data = await response.json();
      console.log(data);

    } catch (error) {
      console.log(error);
    }
  }

  return (
    <div className="App">
      <button 
        className="button"
        onClick={onSubmitHandler}
      >
        Get Recommendations!
      </button>
    </div>
  );
}

export default App;
